import React from 'react';
import { Routes, Route } from 'react-router-dom';
import { SocketProvider } from './contexts/SocketContext.tsx';

// Components
import Navbar from './components/layout/Navbar.tsx';
import Footer from './components/layout/Footer.tsx';
import LoadingSpinner from './components/common/LoadingSpinner.tsx';

// Pages
import HomePage from './pages/HomePage.tsx';
import EventsPage from './pages/EventsPage.tsx';
import EventDetailPage from './pages/EventDetailPage.tsx';
import TicketsPage from './pages/TicketsPage.tsx';
import TicketDetailPage from './pages/TicketDetailPage.tsx';
import LoginPage from './pages/LoginPage.tsx';
import RegisterPage from './pages/RegisterPage.tsx';
import ProfilePage from './pages/ProfilePage.tsx';
import MyTicketsPage from './pages/MyTicketsPage';
import MyBidsPage from './pages/MyBidsPage';
import MyListingsPage from './pages/MyListingsPage';
import CreateEventPage from './pages/CreateEventPage.tsx';
import AdminEventsPage from './pages/AdminEventsPage.tsx';
import AdminEventTicketsPage from './pages/AdminEventTicketsPage.tsx';
import AdminDashboard from './pages/AdminDashboard';
import AdminUsers from './pages/admin/Users.tsx';
import AdminEvents from './pages/AdminEvents';
import AdminTickets from './pages/admin/Tickets.tsx';
import ProtectedRoute from './components/auth/ProtectedRoute.tsx';
import AdminRoute from './components/auth/AdminRoute.tsx';

function App() {
  // If you want to use loading from AuthContext, import and use useAuth here
  // const { loading } = useAuth();
  // if (loading) return <LoadingSpinner />;

  return (
    <SocketProvider>
      <div className="min-h-screen flex flex-col">
        <Navbar />
        <main className="flex-1">
          <Routes>
            {/* Public Routes */}
            <Route path="/" element={<HomePage />} />
            <Route path="/events" element={<EventsPage />} />
            <Route path="/events/:id" element={<EventDetailPage />} />
            <Route path="/tickets" element={<TicketsPage />} />
            <Route path="/tickets/:id" element={<TicketDetailPage />} />
            <Route path="/login" element={<LoginPage />} />
            <Route path="/register" element={<RegisterPage />} />

            {/* Protected Routes */}
            <Route
              path="/profile"
              element={
                <ProtectedRoute>
                  <ProfilePage />
                </ProtectedRoute>
              }
            />
            <Route
              path="/my-tickets"
              element={
                <ProtectedRoute>
                  <MyTicketsPage />
                </ProtectedRoute>
              }
            />
            <Route
              path="/my-bids"
              element={
                <ProtectedRoute>
                  <MyBidsPage />
                </ProtectedRoute>
              }
            />
            <Route
              path="/my-listings"
              element={
                <ProtectedRoute>
                  <MyListingsPage />
                </ProtectedRoute>
              }
            />

            {/* Admin Routes */}
            <Route
              path="/admin"
              element={
                <AdminRoute>
                  <AdminDashboard />
                </AdminRoute>
              }
            />
            <Route
              path="/admin/users"
              element={
                <AdminRoute>
                  <AdminUsers />
                </AdminRoute>
              }
            />
            <Route
              path="/admin/events"
              element={
                <AdminRoute>
                  <AdminEventsPage />
                </AdminRoute>
              }
            />
            <Route
              path="/admin/events/create"
              element={
                <AdminRoute>
                  <CreateEventPage />
                </AdminRoute>
              }
            />
            <Route
              path="/admin/tickets"
              element={
                <AdminRoute>
                  <AdminTickets />
                </AdminRoute>
              }
            />
            <Route
              path="/admin/events/:eventId/tickets"
              element={
                <AdminRoute>
                  <AdminEventTicketsPage />
                </AdminRoute>
              }
            />
          </Routes>
        </main>
        <Footer />
      </div>
    </SocketProvider>
  );
}

export default App;
